import React from 'react'
import './style.css'

export default function Navbar() {
  return (
    <div className='dash-nav'>
      <nav>
        <h1>Welcome user</h1>
        <div>Profile</div>
        <div>Logout</div>
      </nav>
    </div>
  )
}
